import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";

const eventRegister2 = () => {
  return (
    <div>
    <MDBContainer>
      <MDBRow>
        <MDBCol size="4">.col-4</MDBCol>
        <MDBCol size="4">.col-4</MDBCol>
        <MDBCol size="4">.col-4</MDBCol>
      </MDBRow>

      <MDBRow>
        <MDBCol sm="4">.col-sm-4</MDBCol>
        <MDBCol sm="4">.col-sm-4</MDBCol>
        <MDBCol sm="4">.col-sm-4</MDBCol>
      </MDBRow>

      <MDBRow>
        <MDBCol md="4">.col-md-4</MDBCol>
        <MDBCol md="4">.col-md-4</MDBCol>
        <MDBCol md="4">.col-md-4</MDBCol>
      </MDBRow>

      <MDBRow>
        <MDBCol lg="4">.col-lg-4</MDBCol>
        <MDBCol lg="4">.col-lg-4</MDBCol>
        <MDBCol lg="4">.col-lg-4</MDBCol>
      </MDBRow>

      <MDBRow>
        <MDBCol xl="4">.col-xl-4</MDBCol>
        <MDBCol xl="4">.col-xl-4</MDBCol>
        <MDBCol xl="4">.col-xl-4</MDBCol>
      </MDBRow>
    </MDBContainer>
    <style jsx>{`
      .hero {
        width: 100%;
        color: #333;
      }
      .title {
        margin: 0;
        width: 100%;
        padding-top: 80px;
        line-height: 1.15;
        font-size: 48px;
      }
      .title,
      .description {
        text-align: center;
      }
      .row {
        max-width: 880px;
        margin: 80px auto 40px;
        display: flex;
        flex-direction: row;
        justify-content: space-around;
      }
      .card {
        padding: 18px 18px 24px;
        width: 220px;
        text-align: left;
        text-decoration: none;
        color: #434343;
        border: 1px solid #9b9b9b;
      }
      .card:hover {
        border-color: #067df7;
      }
      .card h3 {
        margin: 0;
        color: #067df7;
        font-size: 18px;
      }
      .card p {
        margin: 0;
        padding: 12px 0 0;
        font-size: 13px;
        color: #333;
      }
    `}</style>
    </div>
  );
}

export default eventRegister2;
